import { useState } from 'react';
import { TrendingUp, Calendar, BarChart3, Calculator, User, LogOut } from 'lucide-react';
import CustosInsumos from './components/CustosInsumos';
import CustosPratos from './components/CustosPratos';
import OutrosCustos from './components/OutrosCustos';
import PrecificacaoLucro from './components/PrecificacaoLucro';
import ControleDiario from './components/ControleDiario';
import ControleMensal from './components/ControleMensal';
import Calculadora from './components/Calculadora';
import PerfilUsuario from './components/PerfilUsuario';
import Login from './components/Login';
import { UserProvider, useUser } from './lib/UserContext';

const tabs = [
  { id: 'custos-insumos', label: 'Custos' },
  { id: 'custos-pratos', label: 'Pratos' },
  { id: 'outros-custos', label: 'Outros' },
  { id: 'precificacao-lucro', label: 'Preços', icon: TrendingUp },
  { id: 'controle-diario', label: 'Diário', icon: Calendar },
  { id: 'controle-mensal', label: 'Mensal', icon: BarChart3 },
  { id: 'calculadora', label: 'Calculadora', icon: Calculator },
];

function AppContent() {
  const [activeTab, setActiveTab] = useState('custos-insumos');
  const [showProfile, setShowProfile] = useState(false);
  const { user, setUser, logout, loading } = useUser();

  const handleLogin = (userData: any) => {
    setUser(userData);
  };

  const handleLogout = async () => {
    await logout();
    setShowProfile(false);
  };

  const handleUserUpdate = (updatedUser: any) => {
    setUser(updatedUser);
  };

  const renderTabContent = () => {
    
    switch (activeTab) {
      case 'custos-insumos':
        return <CustosInsumos />;
      case 'custos-pratos':
        return <CustosPratos />;
      case 'outros-custos':
        return <OutrosCustos />;
      case 'precificacao-lucro':
        return <PrecificacaoLucro />;
      case 'controle-diario':
        return <ControleDiario />;
      case 'controle-mensal':
        return <ControleMensal />;
      case 'calculadora':
        return <Calculadora />;
      default:
        return <CustosInsumos />;
    }
  };

  if (loading) {
    return (
      <div className="login-container">
        <div className="loading-spinner" />
      </div>
    );
  }

  if (!user) {
    return <Login onLogin={handleLogin} />;
  }

  return (
    <div className="app-container">
      {/* Top Navigation Bar */}
      <header className="top-nav">
        <div className="nav-brand">
  <img
    src="data:image/png;base64,"
    alt="Logo"
    style={{ height: 45, borderRadius: 0 }}
  />
        </div>
        
        <nav className="nav-menu">
          {tabs.map((tab) => {
            return (
              <button
                key={tab.id}
                className={`nav-item ${activeTab === tab.id && !showProfile ? 'active' : ''}`}
                onClick={() => {
                  setActiveTab(tab.id);
                  setShowProfile(false);
                }}
              >
                {tab.label}
              </button>
            );
          })}
        </nav>

        <div className="nav-actions">
          <button 
            className={`nav-icon ${showProfile ? 'active' : ''}`}
            onClick={() => setShowProfile(!showProfile)}
            title={`${user?.name} (${user?.email})`}
          >
            <User size={20} />
          </button>
          <button 
            className="nav-icon"
            onClick={handleLogout}
            title="Sair"
          >
            <LogOut size={20} />
          </button>
        </div>
      </header>

      <div className="container">
        <main className="animate-fadeIn">
          {showProfile ? (
            <PerfilUsuario currentUser={user} onUserUpdate={handleUserUpdate} />
          ) : (
            renderTabContent()
          )}
        </main>
      </div>
    </div>
  );
}

function App() {
  return (
    <UserProvider>
      <AppContent />
    </UserProvider>
  );
}

export default App; 